window.bookSummaryJSON = "<p><b>In a void suspended in time, I find myself trapped in an abyss of darkness and despair.</b></p> <p>With every ounce of strength, I fight to free myself from this suffocating sleep while Kalyll, consumed by a fierce determination, searches tirelessly through the realm. His sole mission: to exact revenge upon those responsible for bringing me to the edge of death. No one shall escape his wrath, for everyone in his path will suffer the consequences.</p> <p>Yet, the fate of his kingdom teeters precariously as his treacherous brother, Cardian, schemes to plunge the realm into all-out war. Cardian's alliance with the heartless and ambitious Unseelie King threatens to shatter the fragile peace that remains.</p> <p>In a cruel twist of fate, Kalyll falls into the clutches of his enemies, leaving the specter of war looming ever closer.</p> <p>As time runs out, can I wake from my dark slumber and restore the light before the darkness consumes us all? The final battle looms, and our love hangs in the balance.</p> <p><i>This</i> Beauty and the Beast <i>retelling features a troubled prince, a strong heroine, and an amazing supporting cast. Enemies-to-lovers series suitable for mature listeners. For fans of Sarah J. Maas and Jennifer L. Armentrout.</i></p>"; 
